import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';

const BookedTickets = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const { formData, movie } = location.state || {};

  const handleWithdraw = () => {
    // Logic to handle withdrawal, e.g., removing from a database or state
    alert('Ticket withdrawal functionality not implemented.');
    navigate('/'); // Navigate back to home or another page
  };

  return (
    <div className="booked-tickets">
      <h1>Booking Confirmation</h1>
      <p>Thank you for booking!</p>
      {movie && (
        <div className="movie-details">
          <h2>{movie.title}</h2>
          <img src={movie.image} alt={movie.title} />
        </div>
      )}
      <h2>Details:</h2>
      <p>Name: {formData?.name}</p>
      <p>Email: {formData?.email}</p>
      <p>Number of Tickets: {formData?.tickets}</p>
      <p>Payment Method: {formData?.paymentMethod}</p>
      <p>Selected Chairs: {formData?.chairs.join(', ')}</p>
      <button onClick={handleWithdraw}>Withdraw Ticket</button>
    </div>
  );
};

export default BookedTickets;
